/* Select2 4.0.13 | https://github.com/select2/select2/blob/master/LICENSE.md */

export default {
  inputTooLong(e) {
    const n = e.input.length - e.maximum;
    const t = `Sisesta ${n} täht`;
    return 1 !== n ? (t += "e") : t;
  },
  inputTooShort(e) {
    const n = e.minimum - e.input.length;
    const t = `Sisesta ${n} täht`;
    return 1 !== n ? (t += "e") : t;
  },
  loadingMore() {
    return "Laen tulemusi…";
  },
  maximumSelected(e) {
    const n = `Saad vaid ${e.maximum} tulemus`;
    return 1 === e.maximum ? (n += "e") : (n += "t");
  },
  noResults() {
    return "Tulemused puuduvad";
  },
  searching() {
    return "Otsin…";
  },
  removeAllItems() {
    return "Eemalda kõik esemed";
  },
};
